import * as ReactDOM from 'react-dom';
import * as React from 'react';
import { render } from 'react-dom';
import { SampleBase } from '../common/sample-base';
import { DocumentEditorContainerComponent, Toolbar } from '@syncfusion/ej2-react-documenteditor';
import { TitleBar } from './title-bar';
import { ButtonComponent } from '@syncfusion/ej2-react-buttons';
import './default.component.css';
import { MultiSelectComponent, CheckBoxSelection, Inject } from '@syncfusion/ej2-react-dropdowns';
import { CheckBoxComponent } from '@syncfusion/ej2-react-buttons';
DocumentEditorContainerComponent.Inject(Toolbar);

// tslint:disable:max-line-length
export class ToolbarCustomization extends SampleBase<{}, {}> {
    private items = ['New', 'Open', 'Undo',
        'Redo',
        'Comments',
        'Image',
        'Table',
        'Hyperlink',
        'Bookmark',
        'TableOfContents',
        'Header',
        'Footer',
        'PageSetup',
        'PageNumber',
        'Break',
        'Find',
        'LocalClipboard',
        'RestrictEditing'];
    private hostUrl: string = 'https://services.syncfusion.com/react/production/api/documenteditor/';
    public container: DocumentEditorContainerComponent;
    public multiSelect: MultiSelectComponent;
    public titleBar: TitleBar;
    public rendereComplete(): void {
        window.onbeforeunload = function () {
            return 'Want to save your changes?';
        }
        this.container.documentEditor.pageOutline = '#E0E0E0';
        this.container.documentEditor.acceptTab = true;
        this.container.documentEditor.resize();
        this.titleBar = new TitleBar(document.getElementById('documenteditor_titlebar'), this.container.documentEditor, true);
        this.onLoadDefault();
    }

    private customize() {
        let toolbaritems : any = this.multiSelect.value;
        this.container.toolbarItems = toolbaritems;
    }
    render() {
        return (<div className='control-pane'>
            <div className="col-lg-9 control-section">
                <div id='documenteditor_titlebar' className="e-de-ctn-title"></div>
                <div id="documenteditor_container_body">
                    <DocumentEditorContainerComponent id="container" ref={(scope) => { this.container = scope; }} style={{ 'display': 'block' }}
                       height={'590px'} serviceUrl={this.hostUrl} enableToolbar={true} locale='en-US' />
                </div>
            </div>
            <div className="col-lg-3 property-section">
                <div className="property-panel-header">Select toolbar items</div>
                <div>
                    <div id="multigroup" className="control-styles">
                        <MultiSelectComponent id="checkbox" ref={(scope) => { this.multiSelect = scope; }} dataSource={this.items} placeholder="Select toolbar items" mode="CheckBox" showSelectAll={true} showDropDownIcon={true} filterBarPlaceholder="Search toolbar items" popupHeight="350px">
                            <Inject services={[CheckBoxSelection]} />
                        </MultiSelectComponent>
                    </div><br></br>
                </div>
                <div className="evtbtn">
                    <ButtonComponent id="customize" onClick={this.customize.bind(this)}>Customize</ButtonComponent>
                </div>
            </div>
            <div id="action-description">
                <p>This example explains how to show or hide existing items in the toolbar.</p>
            </div>
            <div id="description">
                <p>Existing toolbar items can be hidden, shown, enabled, and disabled. Also, new items can be added to the toolbar.</p>
                <p style={{ 'display': 'block' }}> More information about the document editor features can be found in this <a target="_blank" href="https://ej2.syncfusion.com/react/documentation/document-editor/how-to/customize-tool-bar/">documentation section.</a>
                </p>
            </div>
        </div>);
    }
    onLoadDefault = (): void => {
        // tslint:disable
        let defaultDocument: object ={"sfdt":""};
        // tslint:enable        
        this.container.documentEditor.open(JSON.stringify(defaultDocument));
        this.container.documentEditor.documentName = 'Toolbar Customization';
        this.titleBar.updateDocumentTitle();
        this.container.documentChange = (): void => {
            this.titleBar.updateDocumentTitle();
            this.container.documentEditor.focusIn();
        };
    }
}